ntifiable_id":10440,"identifiable_type":"Contributor","created_at":"2022-05-19 13:52:27 UTC","updated_at":"2022-05-19 13:52:27 UTC"},{"id":3464,"value":"https://orcid.org/ 0000-0002-1539-8141","attrs":null,"identifier_scheme_id":1,"identifiable_id":10441,"identifiable_type":"Contributor","created_at":"2022-05-19 13:53:23 UTC","updated_at":"2022-05-19 13:53:23 UTC"},{"id":3465,"value":"https://orcid.org/0000-0002-8211-4284","attrs":"{\"provider\":\"orcid\",\"uid\":\"0000-0002-8211-4284\",\"info\":{\"name\":\"Dana  Haggarty\",\"email\":null,\"first_name\":\"Dana \",\"last_name\":\"Haggarty\",\"location\":null,\"description\":null,\"urls\":[]},\"credentials\":{\"token\":\"598a1e5c-05da-437a-a872-8c84f5f33246\",\"refresh_token\":\"6e112311-6c05-4fd9-899f-87f6111b5174\",\"expires_at\":2284117196,\"expires\":true},\"extra\":{\"raw_info\":{\"first_name\":\"Dana \",\"last_name\":\"Haggarty\",\"other_names\":[],\"description\":null,\"location\":null,\"email\":null,\"urls\":[],\"external_identifiers\":[]}}}","identifier_scheme_id":1,"identifiable_id":22347,"identifiable_type":"User","created_at":"2022-05-19 16:44:39 UTC","updated_at":"2022-05-19 16:44:39 UTC"},{"id":3466,"value":"IN240","attrs":null,"identifier_scheme_id":null,"identifiable_id":9036,"identifiable_type":"Plan","created_at":"2022-05-19 17:20:06 UTC","updated_at":"2022-05-19 17:20:06 UTC"},{"id":3467,"value":"https://orcid.org/0000-0002-9812-7266","attrs":"{\"provider\":\"orcid\",\"uid\":\"0000-0002-9812-7266\",\"info\":{\"name\":\"Simon Côté-Lapointe\",\"email\":null,\"first_name\":\"Simon\",\"last_name\":\"Côté-Lapointe\",\"location\":\"CA\",\"description\":\"FR \\n\\nSimon Côté-Lapointe est détenteur d’un Ph. D. en sciences de l’information de l’Université de Montréal. Depuis 2012, il a été chargé de projet pour l’Association internationale des archives francophones (AIAF) en plus de participer à plusieurs projets de recherche universitaires en lien avec les archives. En 2020, il a travaillé comme bibliothécaire spécialiste en gestion des documents numériques à Bibliothèque et Archives nationales du Québec (BAnQ). Il est présentement bibliothécaire à l’Université du Québec à Montréal (UQAM) où il s’intéresse notamment aux humanités numériques. La création à partir d’archives, l’organisation et la diffusion des archives audiovisuelles, la notion de facettes appliquée en archivistique ainsi que la préservation numérique sont parmi ses champs d’intérêt. \\n\\nENG \\n\\nSimon Côté-Lapointe holds a PhD in Information Science from the Université de Montreal. Since 2012, he has been a project manager for l’Association internationale des archives francophones (AIAF) in addition to participating in several university research projects related to archives. In 2020, he worked as a librarian specialized in digital document management at Bibliothèque et Archives nationales du Québec (BAnQ). He is currently librarian at Université du Québec à Montréal (UQAM). Creation with archives, organization and distribution of audiovisual archives, notion of facets applied in archival science as well as digital preservation are among his areas of focus.\",\"urls\":[{\"Site personnel\":\"http://simoncotelapointe.com/\"}]},\"credentials\":{\"token\":\"b3656df7-3ccc-418e-bdc2-5efaab0ceac8\",\"refresh_token\":\"937d26f1-30de-41f0-b507-8b18fe991792\",\"expires_at\":2284195671,\"expires\":true},\"extra\":{\"raw_info\":{\"first_name\":\"Simon\",\"last_name\":\"Côté-Lapointe\",\"other_names\":[\"Simon Olivier Côté-Lapointe\"],\"description\":\"FR \\n\\nSimon Côté-Lapointe est détenteur d’un Ph. D. en sciences de l’information de l’Université de Montréal. Depuis 2012, il a été chargé de projet pour l’Association internationale des archives francophones (AIAF) en plus de participer à plusieurs projets de recherche universitaires en lien avec les archives. En 2020, il a travaillé comme bibliothécaire spécialiste en gestion des documents numériques à Bibliothèque et Archives nationales du Québec (BAnQ). Il est présentement bibliothécaire à l’Université du Québec à Montréal (UQAM) où il s’intéresse notamment aux humanités numériques. La création à partir d’archives, l’organisation et la diffusion des archives audiovisuelles, la notion de facettes appliquée en archivistique ainsi que la préservation numérique sont parmi ses champs d’intérêt. \\n\\nENG \\n\\nSimon Côté-Lapointe holds a PhD in Information Science from the Université de Montreal. Since 2012, he has been a project manager for l’Association internationale des archives francophones (AIAF) in addition to participating in several university research projects related to archives. In 2020, he worked as a librarian specialized in digital document management at Bibliothèque et Archives nationales du Québec (BAnQ). He is currently librarian at Université du Québec à Montréal (UQAM). Creation with archives, organization and distribution of audiovisual archives, notion of facets applied in archival science as well as digital preservation are among his areas of focus.\",\"location\":\"CA\",\"email\":null,\"urls\":[{\"Site personnel\":\"http://simoncotelapointe.com/\"}],\"external_identifiers\":[]}}}","identifier_scheme_id":1,"identifiable_id":22361,"identifiable_type":"User","created_at":"2022-05-20 14:32:34 UTC","updated_at":"2022-05-20 14:32:34 UTC"},{"id":3468,"value":"CIMP226","attrs":null,"identifier_scheme_id":null,"identifiable_id":9263,"identifiable_type":"Plan","created_at":"2022-05-20 16:16:58 UTC","updated_at":"2022-05-20 16:16:58 UTC"},{"id":3469,"value":"https://orcid.org/0000-0003-0841-4657","attrs":"{\"provider\":\"orcid\",\"uid\":\"0000-0003-0841-4657\",\"info\":{\"name\":\"John Hogenbirk\",\"email\":null,\"first_name\":\"John\",\"last_name\":\"Hogenbirk\",\"location\":\"CA\",\"description\":null,\"urls\":[{\"Work Profile\":\"http://www.cranhr.ca/#!jhogen/c1ze7\"}]},\"credentials\":{\"token\":\"8ee6dc6a-96d6-4e63-8556-35a08249d404\",\"refresh_token\":\"a34eae43-53b3-43d7-83cc-55f31207098b\",\"expires_at